import React, { useRef } from "react";
import Button from "../Button"

export default function FilterBar(props:{handleClickCharacters: any, handleClickCreators:any, setError: any, setCharacters: any, setCreators: any}) {
    // let input = useRef(null);
    return (
        <form>
        {/* <input type="text" placeholder="Search hero..." ref={input} /> */}
        <Button
          // text={"Search"}
          handleClickCharacters={(e: any) => {
            props.handleClickCharacters(e)
              .then((data: any) => props.setCharacters(data.data.results))
              .catch((err: any) => props.setError(err));
          }}
        />
        <Button
          // text={"Search"}
          handleClickCreators={(e: any) => {
            props.handleClickCreators(e)
              .then((data: any) => props.setCreators(data.data.results))
              .catch((err: any) => props.setError(err));
          }}
        />
      </form>
      );
  }
